    margin-top: 6rem;
}



.feature__heading {
    margin: 1rem 0;
}

.feature__image {
    width: 100%;
}

@media screen and (min-width: 768px) {

    .feature:nth-of-type(even) .feature__content {
        order: 2;
    }
}

